const GridElement = ({ addressName, accessesCount }) => {

  console.log(addressName);
  console.log(accessesCount);

  return (
    <li>
      <p>{`addressName: ${addressName}`}</p>
      <p>{`accessesCount: ${accessesCount}`}</p>
    </li>
  );
};

export default GridElement;
